import React from 'react';

import './Item.css';

const ProductItem = props => {
  return (
    <li className="product-item">
      <h2>Latitude: {props.latitude}</h2>
      <h2>Longitude: {props.longitude}</h2>
    </li>
  );
};

export default ProductItem;
